    align-items: center;
    border-left: 1px solid var(--panel-phone-chat-border-color);
    display: flex;
    height: var(--panel-header-app-height);
    padding: 0 0.2em;

    .name-short {
        color: var(--panel-header-app-text-font-color);
        display: none;
        font-size: 0.9em;
        font-weight: bold;
    }

    .flag {
        height: $pix-20;
        padding: 0 0.2em;
        width: $pix-30;
    }
}

