import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderAppModule } from './components/business/header-app/header-app.module';
import { EmptyRouteComponent } from './empty-route/empty-route.component';

@NgModule({
  declarations: [
    AppComponent,
    EmptyRouteComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HeaderAppModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }

import { APP_BASE_HREF } from '@angular/common';
import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HeaderAppComponent } from './components/business/header-app/header-app.component';
import { EmptyRouteComponent } from './empty-route/empty-route.component';

const routes: Routes = [
  {
    path: "**", 
    component: HeaderAppComponent
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
  providers: [{provide: APP_BASE_HREF, useValue: "/"}]
})
export class AppRoutingModule { }

import { NgModule } from '@angular/core';
import { HeaderAppRoutes } from './header-app-routing.module';

import { HeaderAppComponent } from './header-app.component';
import { LanguageComponent } from "./language/language.component";
import { NotificationComponent } from "./notification/notification.component";
import { ProfileUserComponent } from "./profile-user/profile-user.component";

@NgModule({
  declarations: [
    HeaderAppComponent,
    LanguageComponent,
    NotificationComponent,
    ProfileUserComponent
  ],
  imports: [
    HeaderAppRoutes    
  ],
  providers: [],
  bootstrap: []
})
export class HeaderAppModule { }

